import React from 'react';

const UserProfile = () => {
    return (
        <div className="user-profile">
            <h1>User Profile</h1>
            <p>Welcome to your profile. Here, you can manage your events, bookings, and account settings.</p>
        </div>
    );
};

export default UserProfile;
